import React, { Component } from "react";

import Logged from "./pages/Logged";
import Desloged from "./pages/Desloged";

export default class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      logged: true
    }
  }

  render() {
    return (
      <aside>
      {
        this.state.logged ? <Logged /> : <Desloged />
      }
      </aside>
    );
  }
}
